  isGroupKey: props.isGroupKey,
  getGroupFacets: props.getGroupFacets,
  isDocumentMode: false,
});

const renderItems = createRenderItems();

const maxBucketCount = computed(
  () => props.facets.facetData.value?.maxUniqueValueCount ?? null,
);

const pendingFacetRowCount = ref<number | undefined>(undefined);

