    49→  pendingCategoricalFacets?: { value: { [facetKey: string]: string[] } };
    50→  visibleFacetKeys: { value: string[] };
    51→  facetData?: { value: { facets?: { [facetKey: string]: any } } };
    52→}
    53→
    54→interface UseFacetPanelRendererOptions {
    55→  facetMetadata: { [facetKey: string]: FacetMetadata };
    56→  facets: FacetState;
    57→  getFacetOrder: (facetData?: any) => readonly string[];
    58→  isGroupKey: (key: string) => boolean;
    59→  getGroupFacets: (groupName: string) => string[];
    60→  isDocumentMode?: boolean;
    61→}
    62→
    63→export default function useFacetPanelRenderer(
    64→  options: UseFacetPanelRendererOptions,
    65→) {
    66→  const {
    67→    facetMetadata,
    68→    facets,
    69→    getFacetOrder,
    70→    isGroupKey,
    71→    getGroupFacets,
    72→    isDocumentMode = false,
    73→  } = options;
    74→
    75→  const createFacetItem = (
    76→    facetKey: string,
    77→    aggregateProperties: any,
    78→  ): FacetItem => {
    79→    const displayName = facetMetadata[facetKey]?.displayName ?? facetKey;
    80→    const {
    81→      sortDirection,
    82→      visibleRowCount,
    83→      queryString: bucketQueryString,
    84→    } = facets.getCategoricalFacetDisplayState(facetKey);
    85→
    86→    let selectedBucketKeys: string[];
    87→    let isHistogramFacet: boolean;
    88→
    89→    if (isDocumentMode) {
    90→      selectedBucketKeys = facets.selectedFacets?.value[facetKey] ?? [];
    91→      isHistogramFacet = false; // Document mode always uses false
    92→    } else {
    93→      selectedBucketKeys =
    94→        facets.pendingCategoricalFacets?.value?.[facetKey] ?? [];
    95→      isHistogramFacet =
    96→        facets.isHistogramFacet?.(aggregateProperties) ?? false;
    97→    }
