   101→      displayName,
   102→      isExpanded: facets.isFacetExpanded(facetKey),
   103→      aggregateProperties,
   104→      isHistogramFacet,
   105→      selectedBucketKeys,
   106→      sortDirection,
   107→      visibleRowCount,
   108→      queryString: bucketQueryString,
   109→      icon: facetMetadata[facetKey]?.icon,
   110→      isExtractable: facetMetadata[facetKey]?.isExtractable ?? false,
   111→    };
   112→  };
   113→
   114→  const createEmptyAggregateProperties = (facetKey: string) => {
   115→    if (isDocumentMode) {
   116→      return {
   117→        buckets: [],
   118→        facetKey,
   119→        uniqueValueCount: 0,
   120→      };
   121→    }
   122→    return {
   123→      properties: [],
   124→      uniqueValueCount: 0,
   125→      buckets: [],
   126→    };
   127→  };
   128→
   129→  const isGroupExpanded = (groupName: string): boolean => {
   130→    const groupId = `group:${groupName}`;
   131→    return facets.isFacetExpanded(groupId);
   132→  };
   133→
   134→  const shouldIncludeFacet = (
   135→    facetKey: string,
   136→    aggregateProperties: any,
   137→  ): boolean => {
   138→    const isDerived = facetMetadata[facetKey]?.tags?.includes(
   139→      PropertyTag.Derived,
   140→    );
   141→
   142→    // Show derived facets even without data, others only with data
   143→    return aggregateProperties || isDerived;
   144→  };
   145→
   146→  const createRenderItems = (
   147→    document?: any, // For document mode validation
   148→  ): ComputedRef<RenderItem[]> =>
   149→    computed(() => {
