   157→        : facets.facetData?.value?.facets;
   158→
   159→      const facetOrder = getFacetOrder(facetDataForOrder);
   160→      const facetData = facetDataForOrder ?? {};
   161→      const visibleFacetKeys = facets.visibleFacetKeys.value;
   162→      const items: RenderItem[] = [];
   163→
   164→      facetOrder.forEach(orderKey => {
   165→        if (isGroupKey(orderKey)) {
   166→          if (!visibleFacetKeys.includes(orderKey)) return;
