     7→export default function useFacetMetadata(isDocumentMode: boolean = false) {
     8→  const projectStore = useProjectStore();
     9→
    10→  /**
    11→   * A map from the facet ID (the property descriptor key it represents) to the display name, icon, and expansion state of that
    12→   * property descriptor.
    13→   */
    14→  const facetMetadata = ref<{ [propertyDescriptorKey: string]: FacetMetadata }>(
    15→    {},
    16→  );
    17→
    18→  /**
    19→   * Ordered list of facet keys representing the user's preferred display order
    20→   */
    21→  const facetOrder = ref<string[]>([]);
    22→
    23→  /**
    24→   * Get the localStorage key for storing facet order
    25→   */
    26→  const getStorageKey = () => {
    27→    const mode = isDocumentMode ? 'document' : 'regular';
    28→    const projectId = projectStore.project?.id || 'default';
    29→    return `facetOrder_${mode}_${projectId}`;
    30→  };
    31→
    32→  /**
    33→   * Load facet order from localStorage
    34→   */
    35→  const loadFacetOrder = (): string[] => {
    36→    try {
